$(document).ready(function(){
    $.ajaxSetup({
        headers: {
            'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
        },
    });

    $(document).ajaxError(function (event, jqxhr, settings, thrownError) {
        if (jqxhr.status === 401) {
            window.location = "/";
        }

        if (jqxhr.status === 419) {
            alert('Token a ht han');
            window.location = "";
        }
    });
});

function show_message(message, status = 'success', title = '') {
    var text_html = '';
    if (message) {
        if(Array.isArray(message)){
            for(var i = 0; i < message.length; i++){
                text_html += '<p>'+ message[i] +'</p>';
            };
        }else{
            text_html = message;
        }

        Swal.fire({
            'title': title,
            'html': text_html,
            'type': status,
            'timer': 1500,
        });
    }
}

function replace_template( template, data ){
    return template.replace(
        /{(\w*)}/g,
        function( m, key ){
            return data.hasOwnProperty( key ) ? data[ key ] : "";
        }
    );
}

function open_center_popup(url, title, w, h, set_url = null) {
    var dualScreenLeft = window.screenLeft != undefined ? window.screenLeft : window.screenX;
    var dualScreenTop = window.screenTop != undefined ? window.screenTop : window.screenY;

    var width = window.innerWidth ? window.innerWidth : document.documentElement.clientWidth ? document.documentElement.clientWidth : screen.width;
    var height = window.innerHeight ? window.innerHeight : document.documentElement.clientHeight ? document.documentElement.clientHeight : screen.height;
    var systemZoom = width / window.screen.availWidth;
    var left = (width - w) / 2 / systemZoom + dualScreenLeft;
    var top = (height - h) / 2 / systemZoom + dualScreenTop;
    var newWindow = window.open(url, title, 'scrollbars=yes, width=' + w / systemZoom + ', height=' + h / systemZoom + ', top=' + top + ', left=' + left);
    window.SetUrl = set_url;
    return newWindow;
}

var open_filemanager = function (options, cb) {
    let url = base_url + '/filemanager?type=' + options.type;
    open_center_popup(url, 'Qun l tp tin', 900, 600, cb);
};
jQuery.each( [ "put", "delete" ], function( i, method ) {
    jQuery[ method ] = function( url, data, callback, type ) {
        if ( jQuery.isFunction( data ) ) {
            type = type || callback;
            callback = data;
            data = undefined;
        }

        return jQuery.ajax({
            url: url,
            type: method,
            dataType: type,
            data: data,
            success: callback
        });
    };
});

$(document).ready(function(){

    $('body').on('submit', '.form-ajax', function(event) {
        if (event.isDefaultPrevented()) {
            return false;
        }

        event.preventDefault();
        var form = $(this).closest('form');
        var formData = new FormData(form[0]);
        var btnsubmit = form.find("button[type=submit]");
        var currentIcon = btnsubmit.find('i').attr('class');
        var submitSuccess = form.data('success');
        btnsubmit.find('i').attr('class', 'fa fa-spinner fa-spin');
        btnsubmit.prop("disabled", true);

        $.ajax({
            type: form.attr('method'),
            url: form.attr('action'),
            dataType: 'json',
            data: formData,
            cache:false,
            contentType: false,
            processData: false,
            headers: {
                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
            },
        }).done(function(data) {

            if (data.message){
                Swal.fire({
                    title: title_message,
                    icon: 'info',
                    width: '100%',
                    position: 'center',
                    html: data.message + '<br> <div class="border-bottom pt-5" style="margin: -15px;"></div>',
                    focusConfirm: false,
                    confirmButtonText: "OK",
                }).then((result) => {
                    if (result.value) {
                        if (data.redirect) {
                            window.location.href = data.redirect
                        }
                        return false;
                    }
                });
            }else {
                if (data.redirect) {
                    window.location.href = data.redirect
                }
                return false;
            }

            btnsubmit.find('i').attr('class', currentIcon);
            btnsubmit.prop("disabled", false);

            if (data.status === "error") {
                return false;
            }

            if (submitSuccess) {
                eval(submitSuccess)(form);
            }

            return false;
        }).fail(function(data) {
            btnsubmit.find('i').attr('class', currentIcon);
            btnsubmit.prop("disabled", false);

            show_message('Li d liu', 'error');
            return false;
        });
    });

    $('body').on('click', '.load-modal', function () {
        let item = $(this);
        let oldtext = item.html();
        item.html('<i class="fa fa-spinner fa-spin"></i>');
        item.prop("disabled", true);
        item.addClass('disabled');
        let url = $(this).data('url');
        $('.btn').prop('disabled', true);
        $.ajax({
            type: 'POST',
            url: url,
            dataType: 'html',
            data: {},
        }).done(function(data) {
            $('.btn').prop('disabled', false);
            item.html(oldtext);
            item.prop("disabled", false);
            item.removeClass('disabled');
            $("#app-modal").html(data);
            $("#app-modal #myModal").modal();
        }).fail(function(data) {
            $('.btn').prop('disabled', false);
            item.html(oldtext);
            item.prop("disabled", false);
            show_message('Li d liu', 'error');
            return false;
        });
    });

    $('body').on('click', '.load-media', function () {
        let item = $(this);
        let icon = item.find('i').attr('class');

        item.find('i').attr('class', 'fa fa-spinner fa-spin');

        $.ajax({
            type: 'POST',
            url: base_url + '/load-media',
            dataType: 'html',
            data: {},
        }).done(function(data) {
            item.find('i').attr('class', icon);
            $("#app-modal").html(data);
            $("#app-modal #modal-media").modal();
        }).fail(function(data) {
            item.find('i').attr('i', icon);
            show_message(
                'Li d liu',
                'error'
            );
            return false;
        });
    });

    $("body").on('keypress', '.is-number', function () {
        return validate_isNumberKey(this);
    });

    $("body").on('keyup', '.number-format', function () {
        return validate_FormatNumber(this);
    });

    function validate_isNumberKey(evt) {
        var charCode = (evt.which) ? evt.which : event.keyCode;
        if (charCode == 59 || charCode == 46)
            return true;
        if (charCode > 31 && (charCode < 48 || charCode > 57))
            return false;
        return true;
    }

    function validate_FormatNumber(a) {
        a.value = a.value.replace(/\./gi, "");
        a.value = a.value.replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1.");
    }
});

